`,paraId:22,tocIndex:4},{value:"\u6839\u636E\u8DEF\u7531\u8868\uFF0C\u52A8\u6001\u521B\u5EFA",paraId:23,tocIndex:4},{value:"<Routes>",paraId:23,tocIndex:4},{value:" \u548C ",paraId:23,tocIndex:4},{value:"<Route>",paraId:23,tocIndex:4},{value:"\u793A\u4F8B\u5982\u4E0B",paraId:23,tocIndex:4},{value:`// \u5728router/index\u4E2D\u521B\u5EFA\u8DEF\u7531\u8868
const routers: RouteObject[] = [
  {
    path: '/',
    element: <Layout />,
    children: [
      {
        path: 'home',
        element: lazyLoad(<Home />),
      },
      {
        path: 'swiper',
        element: lazyLoad(<SwiperCom />),
        caseSensitive: true,
      },
      {
        path: 'useparams/:id/:name/:content',
        element: lazyLoad(<UseParams />),
      },
      {
        path: 'usenavigate',
        element: lazyLoad(<UseNavigate />),
      },
      // \u91CD\u5B9A\u5411
      {
        path: '/',
        element: <Navigate to="/home" />,
      },
      // 404
      {
        path: '*',
        element: lazyLoad(<ErrorPage />),
      },
    ],
  },
];
// \u5728App.tsx\u4E2D\uFF0C\u6620\u5165\u8DEF\u7531\u8868\uFF0C\u6CE8\u518C\u8DEF\u7531
import { BrowserRouter as Router, useRoutes } from 'react-router-dom';
import routers from './router';
import { Suspense } from 'react';

function App() {
  // \u7531\u8DEF\u7531\u8868\u751F\u6210\u5BF9\u5E94\u7684\u8DEF\u7531\u89C4\u5219
  const Element = () => useRoutes(routers);
  return (
    <>
      <Suspense fallback={<Spin />}>
        <Router>
          <Element />
        </Router>
      </Suspense>
    </>
  );
}

