import { flushSync } from 'react-dom';

const App: React.FC = () => {
  const [count1, setCount1] = useState(0);
  const [count2, setCount2] = useState(0);
  return (
    <div
      onClick={() => {
        flushSync(() => {
          setCount1((count) => count + 1);
        });
        // \u7B2C\u4E00\u6B21\u66F4\u65B0
        flushSync(() => {
          setCount2((count) => count + 1);
        });
        // \u7B2C\u4E8C\u6B21\u66F4\u65B0
      }}
    >
      <div>count1\uFF1A {count1}</div>
      <div>count2\uFF1A {count2}</div>
    </div>
  );
};

export default App;
