export const Context = React.createContext({ name: '\u5F20\u4E09', age: 18 });
const App = () => {
  return (
    <div>
      <Context.Provider value={{ name: '\u674E\u56DB', age: 20 }}>
        <DemoUseContext />
      </Context.Provider>
    </div>
  );
};
// demo
import { Context } from './app';
const DemoUseContext = () => {
  const context = useContext(Context);
  return (
    <div>
      <p>\u59D3\u540D\uFF1A{context.name}</p>
      <p>\u5E74\u9F84\uFF1A{context.age}</p>
    </div>
  );
};
